INSERT INTO filmy (id_filmu, tytul, rok, rezyser, gatunek1, gatunek2, gatunek3, kraj1, kraj2, kraj3, opis, id_ceny, liczba_wypozyczen, liczba_ocen, srednia_ocen, data_dodania) 
VALUES ('1', 'Podziemny krąg', '1999', '11', '24', '20', NULL, 'DEU', 'USA', NULL, 'Dwóch mężczyzn znudzonych rutyną zakłada klub, w którym co tydzień odbywają się walki na gołe pięści.', '2', '0', '0', '0','2016-07-07 21:23:17'), ('2', 'Harry Potter i Kamień Filozoficzny', '2001', '4', '8', '9', '19', 'USA', 'GBR', NULL, 'W dniu jedenastych urodzin Harry dowiaduje się, że jest czarodziejem. Czeka na niego szkoła magii pełna tajemnic.', '2', '0', '0', '0','2016-07-13 21:23:17'), ('3', 'Dzień świra', '2002', '35', '4', '13', '20', 'POL', NULL, NULL, 'Adaś Miauczyński, 49-letni rozwiedziony polonista, żyje w kręgu swoich natręctw, nie potrafiąc wyrwać się z nudy i rutyny dnia codziennego.', '3', '0', '0', '0','2016-10-12 21:23:17'), ('4', 'Mroczny Rycerz', '2008', '6', '1', '21', NULL, 'USA', 'GBR', NULL, 'Batman, z pomocą porucznika Gordona oraz prokuratora Harveya Denta, występuje przeciwko przerażającemu i nieobliczalnemu Jokerowi, który chce pogrążyć Gotham City w chaosie.', '3', '0', '0', '0','2016-10-12 21:23:17'), ('5', 'Pulp Fiction', '1994', '47', '10', NULL, NULL, 'USA', NULL, NULL, 'Przemoc i odkupienie w opowieści o dwóch płatnych mordercach pracujących na zlecenie mafii, żonie gangstera, bokserze i parze okradającej ludzi w restauracji.', '1', '0', '0', '0','2016-10-30 21:23:17'), ('6', 'Ojciec chrzestny', '1972', '14', '4', '10', NULL, 'USA', NULL, NULL, 'Opowieść o nowojorskiej rodzinie mafijnej. Starzejący się Don Corleone pragnie przekazać władzę swojemu synowi.', '1', '0', '0', '0','2016-11-06 21:23:17'), ('7', 'Dwunastu gniewnych ludzi', '1957', '57', '7', NULL, NULL, 'USA', NULL, NULL, 'Dwunastu przysięgłych ma wydać wyrok w procesie o morderstwo. Jeden z nich ma wątpliwości dotyczące winy oskarżonego.', '3', '0', '0', '0','2016-11-07 21:23:17'), ('8', 'Django', '2012', '47', '25', NULL, NULL, 'USA', NULL, NULL, 'Łowca nagród Schultz i czarnoskóry niewolnik Django wyruszają w podróż, aby odbić żonę tego drugiego z rąk bezlitosnego Calvina Candie\'ego.', '1', '0', '0', '0','2016-11-21 21:23:17'), ('9', 'Mechaniczna pomarańcza', '1971', '58', '4', '21', NULL, 'USA', 'GBR', NULL, 'Alex DeLarge wraz ze swoim gangiem sieje spustoszenie na ulicach. Kiedy trafia do więzienia, otrzymuje propozycję odmiany swojego życia.', '3', '0', '0', '0','2017-02-14 21:23:17'), ('10', 'Skazani na Shawshank', '1994', '16', '4', NULL, NULL, 'USA', NULL, NULL, 'Adaptacja opowiadania Stephena Kinga. Niesłusznie skazany na dożywocie bankier, stara się przetrwać w brutalnym, więziennym świecie.', '1', '0', '0', '0','2017-04-05 21:23:17'), ('11', 'Przerwana lekcja muzyki', '1999', '24', '3', '4', '20', 'DEU', 'USA', NULL, 'Susanna poznaje Lisę w zakładzie psychiatrycznym. Od niej uczy się akceptacji siebie.', '2', '0', '0', '0','2017-05-08 21:23:17'), ('12', 'Shrek', '2001', '1', '2', '8', '13', 'USA', NULL, NULL, 'By odzyskać swój dom, brzydki ogr z gadatliwym osłem wyruszają uwolnić piękną księżniczkę.', '3', '0', '0', '0','2017-06-13 21:23:17'), ('13', 'Chłopcy z ferajny', '1990', '38', '4', '10', NULL, 'USA', NULL, NULL, 'Kilkunastoletni Henry i Tommy DeVito trafiają pod opiekę potężnego gangstera. Obaj szybko uczą się panujących w mafii reguł.', '1', '0', '0', '0','2017-06-23 21:23:17'), ('14', 'Król Lew', '1994', '50', '2', '8', NULL, 'USA', NULL, NULL, 'Targany niesłusznymi wyrzutami sumienia po śmierci ojca mały lew Simba skazuje się na wygnanie, rezygnując z przynależnego mu miejsca na czele stada.', '3', '0', '0', '0','2017-06-29 21:23:17'), ('15', 'Życie jest piękne', '1997', '52', '4', '13', '26', 'ITA', NULL, NULL, 'Zamknięty w obozie koncentracyjnym wraz z synem Guido próbuje przekonać chłopca, że okrutna rzeczywistość jest jedynie formą zabawy dla dorosłych.', '3', '0', '0', '0','2017-07-29 21:23:17'), ('16', 'Donnie Darko', '2001', '48', '4', NULL, NULL, 'USA', NULL, NULL, 'Donnie Darko, uważany za nastolatka z zaburzeniami osobowości, spotyka Franka - tajemniczą postać w kostiumie królika, która zaczyna manipulować jego życiem.', '3', '0', '0', '0','2017-08-04 21:23:17'), ('17', 'Hooligans', '2005', '29', '4', NULL, NULL, 'USA', 'GBR', NULL, 'Matt Buckner po wyrzuceniu ze studiów przyjeżdża do siostry mieszkającej w Londynie. Tam wchodzi w środowisko kibiców lokalnych klubów piłkarskich.', '2', '0', '0', '0','2017-08-14 21:23:17'), ('18', 'Ciekawy przypadek Benjamina Buttona', '2008', '11', '9', '17', NULL, 'USA', NULL, NULL, 'Historia Benjamina Buttona, który zamiast starzeć się - młodniał.', '1', '0', '0', '0','2017-08-20 21:23:17'), ('19', 'Edward Nożycoręki', '1990', '61', '4', '9', NULL, 'USA', NULL, NULL, 'Delikatny chłopak-cyborg, który zamiast dłoni ma nożyce, nagle zostaje bez opieki swojego twórcy. W pobliskim miasteczku poznaje nastolatkę, a potem zakochuje się w niej.', '2', '0', '0', '0','2017-09-03 21:23:17'), ('20', 'Kiler', '1997', '27', '13', '22', NULL, 'POL', NULL, NULL, 'Jerzy Kiler, warszawski taksówkarz, przypadkowo zostaje wzięty za płatnego zabójcę i umieszczony w areszcie. Wyciąga go stamtąd boss świata przestępczego, który oferuje mu nowe zadanie.', '3', '0', '0', '0','2017-09-28 21:23:17'), ('21', 'Więzień nienawiści', '1998', '66', '4', NULL, NULL, 'USA', NULL, NULL, 'Były neonazista po wyjściu z więzienia stara się przekonać młodszego brata, by nie podążał jego śladem.', '2', '0', '0', '0','2017-09-30 21:23:17'), ('22', 'Incepcja', '2010', '6', '23', '24', '21', 'USA', 'GBR', NULL, 'Czasy, gdy technologia pozwala na wchodzenie w świat snów. Złodziej Cobb ma za zadanie wszczepić myśl do śpiącego umysłu.', '2', '0', '0', '0','2017-10-02 21:23:17'), ('23', 'Bruce Wszechmogący', '2003', '64', '9', '13', NULL, 'USA', NULL, NULL, 'Reporter, który narzekał nadmiernie na Boga, otrzymuje jego moc i przekona się, że nie łatwo jest rządzić światem.', '2', '0', '0', '0','2017-10-17 21:23:17'), ('24', 'Złap mnie, jeśli potrafisz', '2002', '59', '14', NULL, NULL, 'CAN', 'USA', NULL, 'Oparta na faktach historia młodego fałszerza, który w latach 60., podając się za pilotów, lekarzy i profesorów, wyłudził z banków ponad 2,5 mln dolarów.', '3', '0', '0', '0','2017-12-05 21:23:17'), ('25', 'Seksmisja', '1983', '27', '13', '21', NULL, 'POL', NULL, NULL, 'W roku 2044 zostają odhibernowani dwaj ostatni przedstawiciele płci męskiej, wprowadzając chaos do idealnego świata rządzonego przez Ligę Kobiet.', '3', '0', '0', '0','2017-12-27 21:23:17'), ('26', 'Whiplash', '2014', '8', '4', '18', NULL, 'USA', NULL, NULL, 'Młody i ambitny perkusista za wszelką cenę pragnie dołączyć do czołówki najwybitniejszych artystów muzyki jazzowej.', '2', '0', '0', '0','2018-01-04 21:23:17'), ('27', 'Infiltracja', '2006', '38', '16', NULL, NULL, 'HKG', 'USA', NULL, 'Tajny policjant w szeregach grupy przestępczej i informator mafii w bostońskiej jednostce dochodzeniowej toczą ze sobą śmiertelną rozgrywkę.', '1', '0', '0', '0','2018-01-13 21:23:17'), ('28', 'Władca Pierścieni: Drużyna Pierścienia', '2001', '45', '9', '19', NULL, 'NZL', 'USA', NULL, 'Podróż hobbita z Shire i jego ośmiu towarzyszy, której celem jest zniszczenie potężnego pierścienia pożądanego przez Czarnego Władcę - Saurona.', '3', '0', '0', '0','2018-03-06 21:23:17'), ('29', 'K-PAX', '2001', '21', '4', NULL, NULL, 'DEU', 'USA', NULL, 'Prot, pacjent szpitala psychiatrycznego, wierzy, że pochodzi z odległej planety K-PAX. Doktor Mark Powell stara się mu udowodnić, że nie jest to możliwe, ale wkrótce sam zaczyna mieć wątpliwości.', '3', '0', '0', '0','2018-03-13 21:23:17'), ('30', 'Nietykalni', '2011', '44', '3', '4', '13', 'FRA', NULL, NULL, 'Sparaliżowany milioner zatrudnia do opieki młodego chłopaka z przedmieścia, który właśnie wyszedł z więzienia.', '3', '0', '0', '0','2018-03-16 21:23:17'), ('31', 'Lśnienie', '1980', '58', '11', NULL, NULL, 'USA', 'GBR', NULL, 'Jack podejmuje pracę stróża odciętego od świata hotelu Overlook. Wkrótce idylla zamienia się w koszmar.', '1', '0', '0', '0','2018-03-25 21:23:17'), ('32', 'Pamiętnik', '2004', '42', '17', NULL, NULL, 'USA', NULL, NULL, 'Stary mężczyz