CREATE TABLE wypozyczenia (id_wypozyczenia int AUTO_INCREMENT not null, PRIMARY KEY (id_wypozyczenia), 
id_uzytkownika int, foreign key (id_uzytkownika) references uzytkownicy(id_uzytkownika), id_filmu int, foreign key (id_filmu) references filmy(id_filmu), 
data_wypozyczenia datetime not null, data_wygasniecia datetime not null);

CREATE UNIQUE INDEX index_wypozyczenia ON wypozyczenia (id_wypozyczenia);

-- automatyczny update wartosci liczba_wypozyczen w tabeli filmy po dodaniu rekordu w tabeli wypozyczenia
DELIMITER $$
CREATE TRIGGER `after_wypozyczenia_insert` AFTER INSERT ON `wypozyczenia`
 FOR EACH ROW BEGIN
UPDATE filmy
SET liczba_wypozyczen = liczba_wypozyczen + 1
WHERE id_filmu = (SELECT id_filmu FROM wypozyczenia ORDER BY id_wypozyczenia DESC LIMIT 1);
END;$$
DELIMITER ;

