CREATE TABLE oceny_filmow (id_oceny int AUTO_INCREMENT not null, PRIMARY KEY (id_oceny), id_uzytkownika int, foreign key (id_uzytkownika) references uzytkownicy(id_uzytkownika), 
id_filmu int, foreign key (id_filmu) references filmy(id_filmu), id_kategorii_oceny int, foreign key (id_kategorii_oceny) references kategorie_ocen(id_kategorii_oceny));

-- automatyczny update wartosci liczba_ocen i srednia_ocen w tabeli filmy po dodaniu rekordu w tabeli oceny filmow
DELIMITER $$
CREATE TRIGGER `after_ocena_insert` AFTER INSERT ON `oceny_filmow`
 FOR EACH ROW BEGIN
UPDATE filmy
SET srednia_ocen = ((srednia_ocen * liczba_ocen) + (SELECT id_kategorii_oceny FROM oceny_filmow ORDER BY id_oceny DESC LIMIT 1)) / (liczba_ocen + 1)
WHERE id_filmu = (SELECT id_filmu FROM oceny_filmow ORDER BY id_oceny DESC LIMIT 1);
UPDATE filmy
SET liczba_ocen = liczba_ocen + 1
WHERE id_filmu = (SELECT id_filmu FROM oceny_filmow ORDER BY id_oceny DESC LIMIT 1);

END;$$
DELIMITER ;

