-- wyszukiwanie filmow danego rezysera
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `filmy_rezysera`(IN `nazwa_rezysera` VARCHAR(50))
    NO SQL
BEGIN
SELECT filmy.tytul, filmy.rok, rezyserzy.nazwa_rezysera, gatunki1.nazwa_gatunku AS gatunek1, gatunki2.nazwa_gatunku AS gatunek2, gatunki3.nazwa_gatunku AS gatunek3, kraje_produkcji1.kraj AS kraj1, kraje_produkcji2.kraj AS kraj2, kraje_produkcji3.kraj AS kraj3, filmy.liczba_wypozyczen, filmy.liczba_ocen, filmy.srednia_ocen, stawki_cenowe.wartosc 
FROM filmy 
LEFT JOIN rezyserzy ON filmy.rezyser = rezyserzy.id_rezysera 
LEFT JOIN gatunki AS gatunki1 ON filmy.gatunek1 = gatunki1.id_gatunku 
LEFT JOIN gatunki AS gatunki2 ON filmy.gatunek2 = gatunki2.id_gatunku 
LEFT JOIN gatunki AS gatunki3 ON filmy.gatunek3 = gatunki3.id_gatunku 
LEFT JOIN kraje_produkcji AS kraje_produkcji1 ON filmy.kraj1 = kraje_produkcji1.kod_kraju 
LEFT JOIN kraje_produkcji AS kraje_produkcji2 ON filmy.kraj2 = kraje_produkcji2.kod_kraju 
LEFT JOIN kraje_produkcji AS kraje_produkcji3 ON filmy.kraj3 = kraje_produkcji3.kod_kraju 
LEFT JOIN stawki_cenowe ON filmy.id_ceny = stawki_cenowe.id_ceny WHERE rezyserzy.nazwa_rezysera LIKE  CONCAT ('%', @p0, '%');
END$$
DELIMITER ;

-- lista adresow e-mail, ktorych uzytkownicy po wypozyczeniu nie oceinli filmu
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `lista_email_wypozyczone_bez_oceny`()
    NO SQL
BEGIN
SELECT uzytkownicy.email, filmy.tytul FROM wypozyczenia JOIN uzytkownicy ON wypozyczenia.id_uzytkownika = uzytkownicy.id_uzytkownika JOIN filmy ON wypozyczenia.id_filmu = filmy.id_filmu WHERE wypozyczenia.id_wypozyczenia NOT IN (SELECT wypozyczenia.id_wypozyczenia FROM uzytkownicy JOIN wypozyczenia ON uzytkownicy.id_uzytkownika = wypozyczenia.id_uzytkownika JOIN oceny_filmow ON uzytkownicy.id_uzytkownika = wypozyczenia.id_uzytkownika JOIN filmy ON filmy.id_filmu = wypozyczenia.id_filmu WHERE wypozyczenia.id_uzytkownika = oceny_filmow.id_uzytkownika AND wypozyczenia.id_filmu = oceny_filmow.id_filmu);
END$$
DELIMITER ;

-- dodanie oceny przez uzytkownika
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `nowa_ocena`(IN `uzytkownik` INT, IN `film` INT, IN `ocena` INT)
    NO SQL
BEGIN
DELETE FROM oceny_filmow WHERE oceny_filmow.id_oceny = (SELECT oceny_filmow.id_oceny FROM oceny_filmow WHERE oceny_filmow.id_uzytkownika = @p0 AND oceny_filmow.id_filmu = @p1);
INSERT INTO oceny_filmow (id_uzytkownika, id_filmu, id_kategorii_oceny)
VALUES (@p0, @p1, @p2);
END$$
DELIMITER ;

-- dodanie wypozyczenia przez uzytkownika
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `nowe_wypozyczenie`(IN `uzytkownik` INT, IN `film` INT)
    NO SQL
BEGIN
INSERT INTO wypozyczenia (id_uzytkownika, id_filmu, data_wypozyczenia, data_wygasniecia)
VALUES (@p0, @p1, now(), ADDDATE(now(), INTERVAL 30 DAY));
END$$
DELIMITER ;

-- dodanie uzytkownika
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `nowy_uzytkownik`(IN `email` VARCHAR(50), IN `login` VARCHAR(50), IN `haslo` VARCHAR(20))
    NO SQL
BEGIN
INSERT INTO uzytkownicy (email, login, haslo, data_dolaczenia) VALUES (@p0, @p1, @p2, now());
END$$
DELIMITER ;

-- lista ocenionych filmow przez danego uzytkownika
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `oceny_uzytkownika`(IN `uzytkownik` INT)
    NO SQL
BEGIN
SELECT filmy.tytul, oceny_filmow.id_kategorii_oceny FROM oceny_filmow JOIN filmy ON oceny_filmow.id_filmu = filmy.id_filmu WHERE oceny_filmow.id_uzytkownika = @p0 ORDER BY oceny_filmow.id_kategorii_oceny DESC;
END$$
DELIMITER ;

-- top 10 wg. liczby ocen
DELIMITER $$
