    NO SQL
BEGIN
SELECT filmy.tytul, filmy.rok, rezyserzy.nazwa_rezysera, gatunki1.nazwa_gatunku AS gatunek1, gatunki2.nazwa_gatunku AS gatunek2, gatunki3.nazwa_gatunku AS gatunek3, kraje_produkcji1.kraj AS kraj1, kraje_produkcji2.kraj AS kraj2, kraje_produkcji3.kraj AS kraj3, filmy.liczba_wypozyczen, filmy.liczba_ocen, filmy.srednia_ocen, stawki_cenowe.wartosc 
