DELIMITER ;

-- aktualizacja cen wykonana na podstawie ilosci dni od dodania filmu
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `update_cen`()
    NO SQL
BEGIN
UPDATE filmy
SET filmy.id_ceny = 1
WHERE DATEDIFF(now(), filmy.data_dodania) > 540;
UPDATE filmy
SET filmy.id_ceny = 2
WHERE DATEDIFF(now(), filmy.data_dodania) <= 540 AND DATEDIFF(now(), filmy.data_dodania) > 180;
UPDATE filmy
SET filmy.id_ceny = 3
WHERE DATEDIFF(now(), filmy.data_dodania) <= 180;
END$$
DELIMITER ;

-- wywolanie aktualizacji cen
CALL `update_cen`();

-- historia wypozyczen dla danego uzytkownika
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `wypozyczenia_uzytkownika`(IN `uzytkownik` INT)
    NO SQL
BEGIN
SELECT filmy.tytul, stawki_cenowe.wartosc, wypozyczenia.data_wypozyczenia, wypozyczenia.data_wygasniecia FROM wypozyczenia JOIN filmy ON wypozyczenia.id_filmu = filmy.id_filmu JOIN stawki_cenowe ON filmy.id_ceny = stawki_cenowe.id_ceny WHERE @p0 = wypozyczenia.id_uzytkownika ORDER BY wypozyczenia.data_wypozyczenia DESC;
END$$
DELIMITER ;

